    },
    tipo: {
        type: Sequelize.TEXT
    },
    anio_torneo: {
        type: Sequelize.INTEGER
    },
    tipo_torneo: {
        type: Sequelize.TEXT
    },
    id_tabla:{
        type: Sequelize.INTEGER,
        unique:true
    }
}, {
