import TablaActualizadaService from '../services/TablaActualizadaService';
import Util from '../utils/Utils';

const util = new Util();

class TablaActualizadaController {
    static async crearTablaActualizada(req, res) {    
        try {    
            const nuevaTablaActualizada = req.body;
            const TablaActualizadaCreada = await TablaActualizadaService.agregarTablaActualizada(nuevaTablaActualizada);

            util.setSuccess(201,'Tabla Actualizada añadida', TablaActualizadaCreada);
            return util.send(res);
        }
        catch (error){
            util.setError(400,error.message);
            return util.send(res);
        }
    }

    static async obtenerTablasActualizadas(req, res){
        try {
            const tablasActualizadas = await TablaActualizadaService.obtenerTablasActualizadas();
            
            if(tablasActualizadas && tablasActualizadas.length > 0){
                util.setSuccess(200,'Tablas_Actualizadas obtenidas',tablasActualizadas);
            }
            else{
                util.setSuccess(200,'No se encuentran Tablas_Actualizadas'); 
            }
            return util.send(res);
        } 
        catch (error) {
            util.setError(400,error.message);   
            return util.send(res);   
        }
    }

    static async obtenerTablaActualizada(req, res){
        try {
            const id_tabla = req.params.id;
            const tablaActualizada = await TablaActualizadaService.obtenerTablaActualizada(id_tabla);
            
            if(tablaActualizada){
                util.setSuccess(200,'Tabla_Actualizada obtenida',tablaActualizada);
            }
            else{
                util.setError(404,`Tabla_Actualizada con id:"${id}" no encontrado`);
            }
            return util.send(res);
        } 
        catch (error) {
            util.setError(404,error.message);   
            return util.send(res);   
        }
    }

    static async eliminarTablaActualizada(req, res){
        try {
            const id_tabla = req.params.id;
            const tablaActualizadaEliminada = await TablaActualizadaService.eliminarTablaActualizada(id_tabla);

            if(tablaActualizadaEliminada){
                util.setSuccess(200,'Tabla_Actualizada eliminada');
            }
            else{
                util.setError(404,`Tabla_Actualizada con id:"${id}" no encontrada`);
            } 

            return util.send(res);
        } 
        catch (error) {
            util.setError(404,error.message);   
            return util.send(res);   
        }
    } 

    static async actualizarTablaActualizada(req, res){
        try {
            const anio = parseInt(req.params.anio);
            const tipo = req.params.tipo;
            const tablaActualizada = req.body;

            const tablaActualizadaActualizado = await TablaActualizadaService.actualizarTablaActualizada(anio,tipo,tablaActualizada);

            if(tablaActualizadaActualizado){
                util.setSuccess(200,'TablaActualizada actualizado',tablaActualizadaActualizado);
            }
            else{
                util.setError(404,`TablaActualizada: "${tipo}" del año: "${anio}" no encontrado`);
            } 

            return util.send(res);
        } 
        catch (error) {
            util.setError(404,error.message);   
            return util.send(res);   
        }
    } 
}

export default TablaActualizadaController;

